export class Main extends Component {


    render() {
        const InfoPage = () =>{
            return(
              <Info />
            )
          }

        return (
            <div >
              <Header />
              <Switch>
              <Route path="/info" component={InfoPage} />

              </Switch>
              <Hoss/>
            </div>
        )
    }
}

export default Main
